const Home = () => {
  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#666', color: '#fff', padding: '2rem', textAlign: 'center', animation: 'fadeIn 1s ease-in' }}>
      <h1 style={{ color: '#ff6600', fontSize: '3rem', marginBottom: '1rem', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>Welcome to My Portfolio</h1>
      <h2 style={{ color: '#fff', fontSize: '2rem', marginBottom: '1rem' }}>Darshan Parmar</h2>
      <p style={{ color: '#ddd', fontSize: '1.2rem', marginBottom: '2rem' }}>
        Computer Engineering Student | Bharuch, Gujarat<br/>
        Passionate about Data Science, Machine Learning, and AI-driven healthcare solutions.
      </p>
      <p style={{ color: '#ccc' }}>Explore my skills, projects, research, and experiences below.</p>
      <div style={{ marginTop: '2rem' }}>
        <a href="https://github.com/ParmarDarshan29" style={{ color: '#ff6600', textDecoration: 'none', margin: '0 1rem', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>GitHub</a>
        <a href="https://linkedin.com/in/dte-gecbh-com-darshan-parmar" style={{ color: '#ff6600', textDecoration: 'none', margin: '0 1rem', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>LinkedIn</a>
        <a href="mailto:connect.darshanparmar@gmail.com" style={{ color: '#ff6600', textDecoration: 'none', margin: '0 1rem', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>Email</a>
      </div>
      <style>
        {`
          @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
          }
        `}
      </style>
    </div>
  );
};

export default Home;
